import React from "react";
import { useNavigate } from "react-router-dom";




const Home = () => {

    const navigate = useNavigate();

    const handleEasy = () => {
        const LinkTo = '/easy';
        navigate(LinkTo);
    }

    return (
        <>
            <div className="home">
                <h2>pocetak</h2>
                <div className="buttons" >
                    <div className="button"
                        onClick={() => handleEasy()}>
                    Easy</div>
                </div>
            </div>
        </>
    )

}
export default Home;
